import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import "./App.css";
import HereDetailScreen from "./screens/HereDetailScreen";
import HomeScreen from "./screens/HomeScreen";

function App() {
  return (
    <BrowserRouter>
      <Route path="/">
        <HomeScreen />
      </Route>
      <Route path="/detail">
        <HereDetailScreen />
      </Route>
    </BrowserRouter>
  );
}

export default App;
